import styled from 'styled-components'
import { ArrowLeftOutlinedIcon } from '@material-ui/icons'

const Container = styled.div`

        height:100vh;
        width:100%;
        display:flex;

`
const Arrow = styled.div`

        height:50px;
        width:50px;
        background-color: #fff7f7;
        border-radius:50%;

`


const Slider = () => {
    return (
        <Container>
            <Arrow>
                <ArrowLeftOutlinedIcon />
            </Arrow>
            <Arrow>
                <ArrowRightOutlinedIcon/>
            </Arrow>
        </Container>
    )
}

export default Slider;
